import React from "react";

const Footer = () => {
  return (
    <div className="main-footer">
      <div className="footer-content">
        <ul>
          <li>
            <a href="/www.linkedin.com">LinkedIn</a>
          </li>
          <li>
            <a href="/www.linkedin.com">Github</a>
          </li>
        </ul>
      </div>
    </div>
  );
};
export default Footer;
